import{_ as a,a as e,b as o,c as r,d as l,e as s,f as n,g as h,h as p,i as d,j as c,k as u,l as m,m as g,n as P,o as b,p as f,q as k,r as w,s as x,t as M}from"./chunks/pixhawk_mini_port_main_out.U8yqhqVz.js";import{_ as t}from"./chunks/3dr_anti_vibration_mounting_foam.DSjkpZu8.js";import{_ as S,c as _,a8 as v,o as C}from"./chunks/framework.BDnHobkS.js";const O=JSON.parse('{"title":"Holybro Pixhawk Mini (Припинено)","description":"","frontmatter":{},"headers":[],"relativePath":"uk/flight_controller/pixhawk_mini.md","filePath":"uk/flight_controller/pixhawk_mini.md"}'),q={name:"uk/flight_controller/pixhawk_mini.md"};function T(I,i,y,N,R,A){return C(),_("div",null,i[0]||(i[0]=[v('<h1 id="holybro-pixhawk-mini-припинено" tabindex="-1">Holybro Pixhawk Mini (Припинено) <a class="header-anchor" href="#holybro-pixhawk-mini-припинено" aria-label="Permalink to &quot;Holybro Pixhawk Mini (Припинено)&quot;">​</a></h1><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>PX4 не розробляє цей (або будь-який інший) автопілот. Contact the <a href="https://holybro.com/" target="_blank" rel="noreferrer">manufacturer</a> for hardware support or compliance issues.</p></div><p>The Holybro <em>Pixhawk<sup>®</sup> Mini</em> autopilot is a next-generation evolution of the Pixhawk. Це близько 1/3 розміру оригінального Pixhawk та має потужніші процесори та сенсори.</p><p>Pixhawk Mini базується на відкритому проекті PX4 і був оптимізований для стеку керування польотом PX4.</p><p><img src="'+a+'" alt="Pixhawk Mini"></p><p>Wiring information is available <a href="#wiring">below</a>.</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>This flight controller was designed by 3DR in collaboration with HobbyKing<sup>&amp;reg;</sup>. Раніше він був відомий як 3DR Pixhawk Mini.</p></div><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>This autopilot is <a href="./../flight_controller/autopilot_pixhawk_standard.html">supported</a> by the PX4 maintenance and test teams.</p></div><h2 id="характеристики" tabindex="-1">Характеристики <a class="header-anchor" href="#характеристики" aria-label="Permalink to &quot;Характеристики&quot;">​</a></h2><p><strong>Processors:</strong></p><ul><li><strong>Main Processor:</strong> STM32F427 Rev 3</li><li><strong>IO Processor:</strong> STM32F103</li></ul><p><strong>Sensors:</strong></p><ul><li><strong>Accel/Gyro/Mag:</strong> MPU9250 <ul><li><a href="https://github.com/PX4/PX4-Autopilot/pull/7618" target="_blank" rel="noreferrer">deprecated</a> by the PX4 firmware</li></ul></li><li><strong>Accel/Gyro:</strong> ICM20608</li><li><strong>Barometer:</strong> MS5611</li></ul><p><strong>Voltage ratings:</strong></p><ul><li><strong>Power module output:</strong> 4.1~5.5V</li><li><strong>Max input voltage:</strong> 45V (10S LiPo)</li><li><strong>Max current sensing:</strong> 90A</li><li><strong>USB Power Input:</strong> 4.1\\`5.5V</li><li><strong>Servo Rail Input:</strong> 0~10V</li></ul><p><strong>Interfaces:</strong></p><ul><li>1 x UART Serial Port (для GPS)</li><li>Spektrum DSM/DSM2/DSM-X® Satellite Compatible RC вхід</li><li>Futaba S BUS® Compatible RC вхід</li><li>PPM Sum Signal RC вхід</li><li>I2C (для цифрових сенсорів)</li><li>CAN (для цифрового керування мотором з сумісними контролерами)</li><li>ADC (для аналогових сенсорів)</li><li>Мікро USB порт</li></ul><p><strong>Weight and dimensions:</strong></p><ul><li><strong>Dimensions:</strong> 38x43x12mm</li><li><strong>Weight:</strong> 15.8g</li></ul><p><strong>GPS module (supplied with kit):</strong></p><ul><li><strong>GNSS receiver:</strong> u-blox<sup>®</sup> Neo-M8N; compass HMC5983</li><li><strong>Weight:</strong> 22.4g</li><li><strong>Dimensions:</strong> 37x37x12mm</li></ul><h2 id="де-купити" tabindex="-1">Де купити <a class="header-anchor" href="#де-купити" aria-label="Permalink to &quot;Де купити&quot;">​</a></h2><p>Припинено.</p><h2 id="призначення-конекторів" tabindex="-1">Призначення конекторів <a class="header-anchor" href="#призначення-конекторів" aria-label="Permalink to &quot;Призначення конекторів&quot;">​</a></h2><p><code>&lt;To be added&gt;</code></p><h2 id="функціі" tabindex="-1">Функції <a class="header-anchor" href="#функціі" aria-label="Permalink to &quot;Функції&quot;">​</a></h2><p>Основні функції Pixhawk Mini:</p><ul><li>Просунутий 32 bit ARM Cortex® M4 Processor що управляється NuttX RTOS</li><li>8 PWM/servo виводів</li><li>Кілька варіантів підключення для додаткової периферії (UART, I2C, CAN)</li><li>Резервні входи живлення та автоматичне перемикання на резервне джерело</li><li>Інтегрований перемикач безпеки та опційна зовнішня кнопка безпеки для легкої активації мотора</li><li>Мультиколірний LED індикатор</li><li>Інтегрований багатотональний п&#39;єзозвуковий індикатор</li><li>microSD-карта для довгострокового логування</li><li>Легкі у використанні конектори Micro JST</li></ul><p>The Pixhawk Mini is shipped with new <strong>GPS module</strong>:</p><ul><li>На основі u-blox M8N</li><li>Одночасний прийом до 3 GNSS (GPS, Galileo, GLONASS, BeiDou)</li><li>Найкраща в галузі навігаційна чутливість -167 dBm</li><li>Безпека та захист цілісності</li><li>Підтримує всі системи супутникового доповнення</li><li>Просунуте виявлення перешкод і спуфінгу</li><li>Варіативність продукту для задоволення вимог до продуктивності та вартості</li></ul><h2 id="набір-комплекту" tabindex="-1">Набір комплекту <a class="header-anchor" href="#набір-комплекту" aria-label="Permalink to &quot;Набір комплекту&quot;">​</a></h2><p>The <em>Pixhawk Mini</em> is shipped with the following contents:</p><table tabindex="0"><thead><tr><th>Компонент</th><th>Зображення</th></tr></thead><tbody><tr><td>Pixhawk Mini Autopilot</td><td><img src="'+e+'" alt="Pixhawk Mini"></td></tr><tr><td>Модуль GPS</td><td><img src="'+o+'" alt="Compass+GPS module"></td></tr><tr><td>Quad Power Distribution Board</td><td><img src="'+r+'" alt="Quad Power Distribution Board"></td></tr><tr><td>8 Channel PWM Breakout board</td><td><img src="'+l+'" alt="8 Channel PWM Breakout board"></td></tr><tr><td>кабель на 4 піна (для I2C)</td><td><img src="'+s+'" alt="4-pin cable (for I2C)"></td></tr><tr><td>RC-in кабель для PPM/SBUS</td><td><img src="'+n+'" alt="RC-in cable for PPM/SBUS"></td></tr><tr><td>6 to 6/4 ‘Y’ адаптер для GPS та додаткових пристроїв I2C</td><td><img src="'+h+'" alt="6 to 6/4 ‘Y’ adapter"></td></tr><tr><td>6-піновий кабель (2) (для плати розподілу живлення та для компасу/gps)</td><td><img src="'+p+'" alt="6 pin cable"></td></tr><tr><td>6-піновий JST для легасі телеметрійного радіо до DF13</td><td><img src="'+d+'" alt="6 pin JST to DF13"></td></tr><tr><td>Запобіжний перемикач</td><td><img src="'+c+'" alt="Safety switch"></td></tr><tr><td>8 Channel PWM Breakout cable</td><td><img src="'+u+'" alt="8 Channel PWM Breakout cable"></td></tr><tr><td>Монтажна піна</td><td><img src="'+t+'" alt="Mounting foam"></td></tr><tr><td>I2C breakout board ? - не входить до списку запчастин у додатку</td><td>-</td></tr></tbody></table><h2 id="додаткові-аксесуари" tabindex="-1">Додаткові аксесуари <a class="header-anchor" href="#додаткові-аксесуари" aria-label="Permalink to &quot;Додаткові аксесуари&quot;">​</a></h2><ul><li>Telemetry Radio Sets: 915 MHz (USA), 433 MHz (European)<div class="info custom-block"><p class="custom-block-title">INFO</p><p>When installing the 3DR telemetry radios, use the connectors that come with Pixhawk Mini, rather than those that come with the radios.</p></div></li></ul><p>:::</p><ul><li><p>Модуль живлення 3DR 10S</p></li><li><p>WiFi Телеметрійне радіо</p></li><li><p>Цифровий датчик швидкості польоту</p></li></ul><h2 id="сумісність" tabindex="-1">Сумісність <a class="header-anchor" href="#сумісність" aria-label="Permalink to &quot;Сумісність&quot;">​</a></h2><h3 id="rc-радіо" tabindex="-1">RC радіо <a class="header-anchor" href="#rc-радіо" aria-label="Permalink to &quot;RC радіо&quot;">​</a></h3><ul><li>PPM вивід RC приймачів</li><li>Spektrum DSM RC приймачі</li><li>Futaba S BUS RC приймачі</li></ul><h3 id="esc-регулятори-швидкості" tabindex="-1">ESC регулятори швидкості <a class="header-anchor" href="#esc-регулятори-швидкості" aria-label="Permalink to &quot;ESC регулятори швидкості&quot;">​</a></h3><ul><li>Всі стандартні ESC з PWM входом</li></ul><h2 id="призначення-пінів-конекторів-виводи-пінів" tabindex="-1">Призначення пінів конекторів (виводи пінів) <a class="header-anchor" href="#призначення-пінів-конекторів-виводи-пінів" aria-label="Permalink to &quot;Призначення пінів конекторів (виводи пінів)&quot;">​</a></h2><p><img src="'+m+'" alt="Pixhawk Mini - Connector Pinouts"></p><h2 id="порівняння-продуктів" tabindex="-1">Порівняння продуктів <a class="header-anchor" href="#порівняння-продуктів" aria-label="Permalink to &quot;Порівняння продуктів&quot;">​</a></h2><h3 id="pixhawk-mini-та-pixhawk-оригінальнии" tabindex="-1">Pixhawk Mini та Pixhawk (оригінальний) <a class="header-anchor" href="#pixhawk-mini-та-pixhawk-оригінальнии" aria-label="Permalink to &quot;Pixhawk Mini та Pixhawk (оригінальний)&quot;">​</a></h3><ul><li>Одна третя розміру - від 50х81.5х15.5мм до 38x43х12мм.</li><li>Процесор Rev 3 для повного використання 2 МБ флеш-пам&#39;яті.</li><li>Покращені датчики, як основний, так і додатковий IMU MPU9250 та ICM20608 відповідно. Результат - це більш стабільний, більш надійний політ і навігація.</li><li>Модуль GPS+Компас включено. Містить Neo M8N з підтримкою GLONASS; компас HMC5983. Очікуйте швидшого та сильнішого захоплення GPS.</li><li>Мікро JST конектори замість DF-13. З ними набагато простіше працювати.</li><li>Інтегрований п&#39;єзозвуковий динамік та запобіжний перемикач.</li><li>Підтримує 4S акумулятори нативно за допомогою включеної плати розподільників потужності (PDB).</li></ul><h3 id="pixhawk-mini-та-pixfalcon" tabindex="-1">Pixhawk Mini та Pixfalcon <a class="header-anchor" href="#pixhawk-mini-та-pixfalcon" aria-label="Permalink to &quot;Pixhawk Mini та Pixfalcon&quot;">​</a></h3><ul><li>Покращені датчики, як основний, так і додатковий IMU MPU9250 та ICM20608 відповідно. Очікуйте кращої обробки вібрацій та надійності.</li><li>Інтерфейс CAN для підтримки UAVCAN.</li><li>Включає 8-канальний вивід сервоприводу для літаків та інших апаратів, яким потрібен заживлений PWM вивід.</li><li>Включає плату розгалуження I2C для загальної кількості 5 з&#39;єднань I2C.</li><li>Аналогічний розмір.</li></ul><p>Pixhawk Mini має вдосконалений процесор та сенсорну технологію від ST Microelectronics® та операційну систему реального часу NuttX, що забезпечує відмінну продуктивність, гнучкість та надійність для керування будь-яким безпілотним транспортним засобом.</p><h2 id="відомі-проблеми" tabindex="-1">Відомі проблеми <a class="header-anchor" href="#відомі-проблеми" aria-label="Permalink to &quot;Відомі проблеми&quot;">​</a></h2><ul><li>Some Pixhawk Minis have a <a href="https://github.com/PX4/PX4-Autopilot/issues/7327#issuecomment-317132917" target="_blank" rel="noreferrer">hardware defect</a> that makes the internal MPU9250 IMU unreliable. <ul><li>The problem is only present in older hardware revisions, because <a href="https://github.com/PX4/PX4-Autopilot/issues/7327#issuecomment-372393609" target="_blank" rel="noreferrer">it was fixed at some point by the manufacturer</a>.</li><li>Щоб перевірити, чи певна плата постраждала чи ні, залиште плату відключеною на деякий час, потім увімкніть її та спробуйте запустити драйвер mpu9250 з командного рядка PX4. Якщо плата пошкоджена, драйвер не запуститься.</li><li>The MPU9250 is <a href="https://github.com/PX4/PX4-Autopilot/pull/7618" target="_blank" rel="noreferrer">disabled by default</a> on the PX4 firmware.</li><li>Дефектні Pixhawk Mini не будуть калібруватися без зовнішнього магнітометра або підключеного GPS, навіть у приміщенні.</li><li>When using an external GPS, <a href="https://github.com/PX4/PX4-Autopilot/pull/7618#issuecomment-320270082" target="_blank" rel="noreferrer">this is not a problem</a> because the secondary ICM20608 provides the accelerometer and the gyro, while the external GPS provides the magnetometer.</li></ul></li></ul><p><a id="wiring"></a></p><h2 id="посібник-зі-швидкого-запуску-підключення" tabindex="-1">Посібник зі швидкого запуску підключення <a class="header-anchor" href="#посібник-зі-швидкого-запуску-підключення" aria-label="Permalink to &quot;Посібник зі швидкого запуску підключення&quot;">​</a></h2><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>The <em>Pixhawk Mini</em> is no longer manufactured or available from 3DR.</p></div><p>This quick start guide shows how power the <a href="./../flight_controller/pixhawk_mini.html">Pixhawk Mini</a> and connect its most important peripherals.</p><h3 id="стандартна-схема-проводки" tabindex="-1">Стандартна схема проводки <a class="header-anchor" href="#стандартна-схема-проводки" aria-label="Permalink to &quot;Стандартна схема проводки&quot;">​</a></h3><p>The image below shows standard <em>quadcopter</em> wiring using the <em>Pixhawk Mini Kit</em> and 3DR Telemetry Radios (along with ESC, motor, battery and a ground control station running on a phone). Ми розглянемо кожен основний елемент в наступних розділах.</p><p><img src="'+g+'" alt="Pixhawk Mini Electronics Wiring for QAV250 (off frame)"></p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>The output wiring/powering is slightly different for other types of vehicles. Це докладніше описано нижче для VTOL, Plane, Copter.</p></div><h3 id="монтаж-та-орієнтація-контролера" tabindex="-1">Монтаж та орієнтація контролера <a class="header-anchor" href="#монтаж-та-орієнтація-контролера" aria-label="Permalink to &quot;Монтаж та орієнтація контролера&quot;">​</a></h3><p>The <em>Pixhawk Mini</em> should be mounted on the frame using vibration-damping foam pads (included in the kit). Вона повинна бути розташувати якомога ближче до центру тяжіння вашого автомобіля верхньою стороною вгору зі стрілкою в напрямку передньої частини автомобіля.</p><p><img src="'+P+'" alt="Pixhawk Mini recommended orientation"></p><p><img src="'+t+'" alt="Mounting foam"></p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>Якщо контролер не може бути змонтований у рекомендованому/стандартному положенні (наприклад, через обмеження місця), вам потрібно буде налаштувати програмне забезпечення автопілота з орієнтацією, яку ви фактично використовували: <a href="./../config/flight_controller_orientation.html">Орієнтація контролера польоту</a>.</p></div><h3 id="gps-компас" tabindex="-1">GPS + Компас <a class="header-anchor" href="#gps-компас" aria-label="Permalink to &quot;GPS + Компас&quot;">​</a></h3><p>Attach the 3DR GPS + Compass to the Pixhawk Mini&#39;s <strong>GPS&amp;I2C</strong> port (top right) using the supplied 6 pin cable. GPS/компас слід монтувати на раму якомога подалі від інших електронних пристроїв, з напрямком вперед транспортного засобу (відокремлення компаса від інших електронних пристроїв зменшить втручання).</p><p><img src="'+b+'" alt="Connecting compass/GPS to Pixhawk Mini"></p><p>NOTE - INSERT IMAGE SHOWING BOTH PORTS? OR FRONT-FACING image of GPS&amp;I2C</p><p>The compass must be calibrated before it is first used: <a href="./../config/compass.html">Compass Calibration</a></p><h3 id="power" tabindex="-1">Power <a class="header-anchor" href="#power" aria-label="Permalink to &quot;Power&quot;">​</a></h3><p>The image below shows typical power-supply wiring when using <em>Pixhawk Mini</em> in a Quadcopter. This uses the <em>Quad Power Distribution Board</em> that comes in the kit to supply both the Pixhawk Mini and the ESC/Motor from the battery (and can also power other accessories).</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>The <em>Quad Power Distribution Board</em> includes a power module (PM) that is suitable for batteries &lt;= 4S. The <em>3DR 10S Power Module</em> (Discontinued) is recommended if you need more power.</p></div><p><img src="'+f+'" alt="Pixhawk Mini - Powering"></p><p>The <em>Pixhawk Mini</em> is powered through the <strong>PM</strong> port. При використанні модуля живлення (як у цьому випадку) порт також буде читати аналогові вимірювання напруги та струму.</p><p>До 4 ESC можна живити окремо від розподільного щита (хоча в цьому випадку підключено лише один).</p><p>Сигнали керування надходять з MAIN OUT. In this case there is only one control channel, which is connected to the ESC via the <em>8 Channel PWM Breakout Board</em>.</p><p>Шина виводу Pixhawk Mini (MAIN OUT) не може живити підключені пристрої (і не потребує цього в схемі, як показано). Для транспортних засобів, де MAIN OUT підключений до пристроїв, які споживають енергію (наприклад, сервопривід, використовуваний у літаку), вам потрібно буде живити рейку за допомогою BEC (елімінаційна схема батареї). Включена плата розподільчого модуля дозволяє одному каналу надавати живлення на інші виходи.</p><h3 id="радіоуправління" tabindex="-1">Радіоуправління <a class="header-anchor" href="#радіоуправління" aria-label="Permalink to &quot;Радіоуправління&quot;">​</a></h3><p>Pixhawk Mini підтримує багато різних моделей радіоприймачів:</p><ul><li><p>Spektrum and DSM receivers connect to the <strong>SPKT/DSM</strong> input.</p><img src="'+k+'" width="350px" title="Pixhawk Mini - Radio port for Spektrum receivers"></li><li><p>PPM-SUM and S.BUS receivers connect to the <strong>RCIN</strong> port.</p><img src="'+w+'" width="350px" title="Pixhawk Mini - Radio port for PPM receivers"></li><li><p>PPM and PWM receivers that have an <em>individual wire for each channel</em> must connect to the <strong>RCIN</strong> port <em>via a PPM encoder</em> <a href="http://www.getfpv.com/radios/radio-accessories/holybro-ppm-encoder-module.html" target="_blank" rel="noreferrer">like this one</a> (PPM-Sum receivers use a single signal wire for all channels).</p></li></ul><p>Для отримання додаткової інформації про вибір радіосистеми, сумісність приймача та зв&#39;язок вашої передавача/приймача, див. статтю: <a href="./../getting_started/rc_transmitter_receiver.html">Пульт керування передавачів &amp; приймачів</a>.</p><h3 id="запобіжнии-перемикач-опціино" tabindex="-1">Запобіжний перемикач (опційно) <a class="header-anchor" href="#запобіжнии-перемикач-опціино" aria-label="Permalink to &quot;Запобіжний перемикач (опційно)&quot;">​</a></h3><p>Контролер має вбудований безпечний перемикач, який ви можете використовувати для активації двигуна, як тільки автопілот готовий злетіти. Якщо на певному транспортному засобі важкодоступний до цього перемикача, ви можете прикріпити (необов’язкову) зовнішню кнопку безпеки, як показано нижче.</p><p><img src="'+x+'" alt="Pixhawk Mini - Optional Switch"></p><h3 id="телеметричні-радіостанціі" tabindex="-1">Телеметричні радіостанції <a class="header-anchor" href="#телеметричні-радіостанціі" aria-label="Permalink to &quot;Телеметричні радіостанції&quot;">​</a></h3><h3 id="двигуни" tabindex="-1">Двигуни <a class="header-anchor" href="#двигуни" aria-label="Permalink to &quot;Двигуни&quot;">​</a></h3><p>The mappings between MAIN/AUX output ports and motor/servos for all supported air and ground frames are listed in the <a href="./../airframes/airframe_reference.html">Airframe Reference</a>.</p><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>Відображення не є однорідним для всіх конструкцій (наприклад, ви не можете покладатися на те, що ручка газу буде на тому ж вихідному порту для всіх повітряних конструкцій). Переконайтеся, що ви використовуєте правильне зіставлення для вашого апарату.</p></div><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Якщо ваша рама не вказана в довідці, використовуйте &quot;загальну&quot; раму відповідного типу.</p><div class="info custom-block"><p class="custom-block-title">INFO</p><ul><li>The output rail must be separately powered, as discussed in the <a href="#power">Power</a> section above.</li><li>Pixhawk Mini не може бути використаний для каркасів QuadPlane VTOL. Це через те, що QuadPlane потребує 9 виводів (4 основних, 5 додаткових) і Pixhawk Mini має лише 8 виводів (8 основних).</li></ul><img src="'+M+'" width="350px" title="Pixhawk Mini - port for motors/servos"><h3 id="інші-периферіині-пристроі" tabindex="-1">Інші периферійні пристрої <a class="header-anchor" href="#інші-периферіині-пристроі" aria-label="Permalink to &quot;Інші периферійні пристрої&quot;">​</a></h3><p>The wiring and configuration of other components is covered within the topics for individual <a href="./../peripherals/">peripherals</a>.</p><h3 id="налаштування" tabindex="-1">Налаштування <a class="header-anchor" href="#налаштування" aria-label="Permalink to &quot;Налаштування&quot;">​</a></h3><p>Загальну інформацію про конфігурацію описано в: <a href="./../config/">Конфігурація автопілота</a>.</p><p>Конкретні конфігурації QuadPlane тут: <a href="./../config_vtol/vtol_quad_configuration.html">QuadPlane VTOL налаштування</a></p><h2 id="збірка-прошивки" tabindex="-1">Збірка прошивки <a class="header-anchor" href="#збірка-прошивки" aria-label="Permalink to &quot;Збірка прошивки&quot;">​</a></h2><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Більшості користувачів не потрібно збирати цю прошивку! It is pre-built and automatically installed by <em>QGroundControl</em> when appropriate hardware is connected.</p></div></div></div><p>To <a href="./../dev_setup/building_px4.html">build PX4</a> for this target:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>make px4_fmu-v3_default</span></span></code></pre></div><h2 id="відладочнии-порт" tabindex="-1">Відладочний порт <a class="header-anchor" href="#відладочнии-порт" aria-label="Permalink to &quot;Відладочний порт&quot;">​</a></h2><p>This board does not have a debug port (i.e it does not have a port for accessing the <a href="./../debug/system_console.html">System Console</a> or <a href="./../debug/swd_debug.html">SWD interface</a>).</p><p>Розробники повинні будуть припаяти дроти до підключених площин для SWD, а також до STM32F4 (IC) TX і RX, щоб отримати консоль.</p>',95)]))}const U=S(q,[["render",T]]);export{O as __pageData,U as default};
